import React from 'react'
import TypeAnimation from 'react-type-animation'

function Hero() {
  return (
    <div className='bg-black min-w-[350px] text-white w-screen h-screen flex flex-col justify-center text-center mt-[-96px] font-semibold'>
        <div className=' text-3xl '>
            <h3>Check out our</h3>
            <TypeAnimation
            cursor={true}
            sequence={[
              'Craft',
              2000,
              'Work.',
              2000,
              'Passion.',
              2000,
            ]}
            wrapper="h3"
            repeat={Infinity}
           />
            
        </div>
        <p className='flex flex-col justify-center text-center'>The one stop shop that'll keep you looking FRESH.</p>
    </div>
  )
}

export default Hero
